import logo from './logo.svg';
import './App.css';
import AddBox from './views/AddBox';
import React from 'react';
import ListBoxes from './views/ListBoxes';
import {BrowserRouter, Route, Switch } from "react-router-dom";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
       <Switch>
          <Route exact path="/addbox">
            <AddBox />
          </Route>
          <Route path="/ListBoxes">
            <ListBoxes />
          </Route>
        </Switch>
    </BrowserRouter>
    </div>

  );
}

export default App;
